import './App.css'
import Loginform from './myProject/Loginform';
import Signup from './myProject/Siginin';
import {BrowserRouter,Link,Routes,Route} from "react-router-dom";
import Navigate from './navigate';
function App() {
  return (
    <div className="App">

        <BrowserRouter>
        <Navigate></Navigate>
        <Routes>
          <Route path="/login" element= <Loginform/> > </Route>
          <Route path="/signup" element= <Signup/> > </Route>
        </Routes>
        </BrowserRouter>


    </div>
  );
}

export default App;
